INSERT INTO `catalog_brend` (`brendID`, `name`, `name_ru`, `folder`, `logo`, `rus`, `ratio`, `arh`, `sort`, `title`, `keyword`, `description`, `h1t`, `descr`) VALUES
(1, 'Apple', 'Эпл', 'apple', 'apple-1.jpg', '', 0, 0, 1, 'Чехлы на айфон. Купить чехлы для айфона - endorphone.com.uaЧехлы на айфон. Купить чехлы для айфона - endorphone.com.ua', 'apple, чехол, аксессуар, endorphone, купить, стоимость, продажа, заказать, чехлы, телефон, мобильный, цена, стоимость', 'Уникальные чехлы для техники iphone, ipad, ipod в интернет-магазине Endorphone. Бесплатная доставка по всей Украине при покупке двух чехлов на айфон, айпад, айпод. Заходи и выбирай свой чехол!', 'Чехлы на айфон, айпад, айпод', '<h2>Лучшие чехлы для культовых гаджетов Apple</h2>\r\n<p><img align="left" alt="Лучшие чехлы для культовых гаджетов Apple" height="211" src="http://endorphone.com.ua/prod_foto/case-iphone-6-sticker-bombing-1-endorphone.jpg" title="Лучшие чехлы для культовых гаджетов Apple endorphone.com.ua" width="229"></p>\r\n<p>Вы являетесь владельцем культовой техники Apple? Продукция знаменитой &laquo;яблочной&raquo; компании привлекает не только революционными разработками программного обеспечения, а и чёткими линиями, гранями совершенного дизайна. Несмотря на стильный внешний вид устройств, не стоит забывать о безопасности корпуса. Как бы бережно вы ни относились к новенькому приобретению, со временем поверхность техники может пострадать от случайных ударов или падений.</p>\r\n<p>Чтобы избежать нежелательного воздействия и сохранить устройство в первозданном виде, стоит обеспечить его надёжной защитой. Мы предлагаем качественные чехлы на &laquo;Айфон&raquo;, &laquo;Айпад&raquo; или &laquo;Айпод&raquo;, которые станут стильным аксессуаром для любимого гаджета. Такая покупка поможет сохранить гладкий металлический корпус в идеальном состоянии, а в некоторых случаях &ndash; избежать дорогостоящей замены внешних деталей.</p>\r\n<h2>&nbsp;</h2>\r\n<h2>&nbsp;</h2>\r\n<h2>Оригинальная &laquo;одежда&raquo; для телефонов</h2>\r\n<p>Решили купить новенький смартфон и ищете изысканный чехол, который подчеркнёт знаменитый дизайн? Или, наоборот, хотите разнообразить внешний вид своего мобильного телефона? В любом случае у нас вы сможете выбрать подходящий аксессуар.</p>\r\n<p>Любители классического дизайна оценят прозрачные защитные силиконовые чехлы для &laquo;Айфона&raquo;, которые бережно предохранят гаджет от повреждений и не скроют эксклюзивный логотип. Для тех, кто хочет выделиться из толпы, мы предлагаем огромный выбор моделей на любой вкус. Культовые фильмы, игры, герои аниме, животные, растения, абстракции, текстуры &ndash; лишь малая часть наименований по определённому типу рисунка.</p>\r\n<p>В каталоге вы найдёте чехлы на iPhone с национальной символикой Украины, чтобы подчеркнуть личный патриотический дух. Романтичные натуры оценят разнообразие изображений на тему Love is&hellip; и &laquo;Цветы&raquo;. Меломаны смогут выделиться с помощью соответствующих картинок из раздела &laquo;Музыка&raquo;. А эпатажные персоны с удовольствием выберут подходящие чехлы для &laquo;Айфона&raquo; &laquo;18+&raquo; и SWAG.</p>\r\n<p>Хотите, чтобы дизайн вашего мобильного менялся в зависимости от настроения? Наш интернет-магазин предоставляет сотни разных вариантов. Цена изделий позволит выбрать и купить несколько разных аксессуаров и каждый день удивлять окружающих оригинальной картинкой.</p>\r\n<p>В зависимости от материалов и функциональности, все чехлы на &laquo;Айфон&raquo; в каталоге разбиты на три категории:</p>\r\n<ol>\r\n	<li>Силиконовые: несмотря на тонкость (толщина изделия всего 0,3 мм) легко выдерживают серьёзные механические нагрузки и защищают все грани корпуса от царапин. Удобный вариант для тех, кто привык носить телефон в кармане.</li>\r\n	<li>Гибридные: универсальная модель надёжно защитит iPhone благодаря прорезиненной вставке внутри и плотного матового пластика снаружи.</li>\r\n	<li>Защитные: эти чехлы на &laquo;Айфон&raquo; &ndash; надёжный способ предохранить гаджет от повреждений любого типа. Силиконовая амортизирующая вставка спасёт телефон даже в результате падения на твёрдую поверхность с большой высоты.</li>\r\n</ol>\r\n<p>От материала изготовления и модели зависит цена аксессуаров. Все категории содержат множество разделов, где вы сможете купить надёжный и стильный &laquo;костюмчик&raquo; для любимого телефона.</p>\r\n<h2>Защита для техники Apple</h2>\r\n<p>Не только владельцы смартфонов нуждаются в стильной защите своих гаджетов. &laquo;Айпод&raquo; и &laquo;Айпад&raquo; эксплуатируются ничуть не меньше телефонов, поэтому также требуют надёжного предохранения. В нашем каталоге представлен широкий выбор &laquo;одёжек&raquo; для любой техники Apple. Чехлы на &laquo;Айпад&raquo; &ndash; не только оригинальный способ сохранить поверхность устройства, а и удобная возможность для транспортировки. Кроме того, этот аксессуар может использоваться в качестве подставки во время общения или просмотра любимого фильма.</p>\r\n<p>Музыка является частью вашей жизни, поэтому уникальный iPod сопровождает каждый шаг? Предлагаем защитить и это устройство. Красочные, изысканные и удобные недорогие чехлы сделают плеер неуязвимым для повреждений в кармане или сумке.</p>\r\n<p>Немаленькая цена гаджетов Apple, например, iPad, говорит о том, что не стоит экономить на безопасности устройств. Стоимость аксессуаров на нашем сайте оправдана надёжным качеством материалов, из которых они изготовлены. Большой популярностью пользуются изысканные чехлы на &laquo;Айпад&raquo; из высокопрочного термостойкого пластика. У нас вы сможете выбрать стильный дизайн на любую модель.</p>\r\n<p>Для стопроцентной безопасности вашего устройства выбирайте товар из&nbsp;категории&nbsp;<a href="http://endorphone.com.ua/protective-case">защитных чехлов</a>. Его свойства направлены в&nbsp;первую очередь на&nbsp;предохранение всех уязвимых мест гаджета:</p>\r\n<ul>\r\n	<li>амортизирующая силиконовая вставка;</li>\r\n	<li>защита всех углов и&nbsp;боков пружинистым силиконом;</li>\r\n	<li>наличие наружной накладки сверху, идеально сочетающейся с&nbsp;внутренней вставкой;</li>\r\n	<li>наличие заглушек для всех разъемов;</li>\r\n	<li>выступ переднего борта для защиты экрана при падении.</li>\r\n</ul>\r\n<p>Достоин внимания также&nbsp;<a href="http://endorphone.com.ua/hybrid-case">гибридный чехол</a>, оснащенный внутренней прорезиненной вставкой и&nbsp;покрытый снаружи плотным глянцевым пластиком. Впереди выступающий бампер защищает экран и&nbsp;переднюю часть смартфона.<o:p></o:p></p>\r\n<p>Кроме надежности, эти чехлы могут быть такими&nbsp;же привлекательными внешне, как и&nbsp;их&nbsp;стандартные собратья. Оформление на&nbsp;любой вкус обеспечивается целым рядом различных тематический категорий. Они разработаны с&nbsp;учетом интересов самых разных потребительских групп.<o:p></o:p></p>\r\n<h2>Чехол как выражение индивидуальности</h2>\r\n<p>Мобильный телефон, плеер или планшет с логотипом Apple уже является выражением высокого статуса и изысканного вкуса владельца. Специалисты компании делают всё, чтобы новые разработки радовали поклонников и привлекали новых покупателей, поэтому популярность устройств растёт не по дням. Обладатели смартфонов и другой &laquo;яблочной&raquo; техники всё чаще заботятся о том, как выразить оригинальный вкус и выделить свой гаджет среди похожих моделей. Стильные чехлы для iPhone, iPad или iPod помогут в этом как нельзя лучше.</p>\r\n<p>На сайте вы можете не только выбрать и купить одну из предлагаемых моделей, а и заказать свой личный эксклюзивный дизайн. Цена такого изделия не отличается от готовых вариантов, поэтому у вас есть уникальная возможность выделиться среди окружающих. Семейные фотографии, селфи, изображения любимых героев или стильные текстуры украсят чехол для iPad, iPhone, iPod по вашему желанию. Кроме того, это отличная идея для оригинального подарка родственникам или друзьям.</p>\r\n<h2>Как заработать с Endorphone?</h2>\r\n<p>Интересует продажа аксессуаров для &laquo;Айфона&raquo; или другой техники Apple в Украине? Мы предлагаем развитие вашего бизнеса по системе дропшиппинга. Оформляйте заказы на торговых площадках в интернете, сайтах или в группах социальных сетей и получайте доход без капиталовложений. Продавая чехол для iPad, iPhone, iPod через посредника, вы получаете доход за счёт разницы оптовой и розничной стоимости товара. Узнайте все подробности о дропшиппинге аксессуаров для &laquo;Айфонов&raquo; на сайте или обращайтесь за консультацией по указанным телефонам.&nbsp;</p>'),
(6, 'Samsung', 'Самсунг', 'samsung', 'samsung-6.jpg', '', 0, 0, 2, 'Чехлы на Самсунг купить на сайте Endorphone', 'samsung, чехол, аксессуар, endorphone, купить, стоимость, продажа, заказать, чехлы, телефон, мобильный, цена, стоимость', 'Большой выбор чехлов для телефона Samsung. Постоянные скидки на чехлы для Самсунг. Уникальные дизайны. Бесплатная доставка по всей Украине. Получи скидку за лайк!', 'Чехлы на Самсунг', '<p><img align="left" alt="Стильные чехлы для вашего верного помощника" height="211" src="http://endorphone.com.ua/prod_foto/case-galaxy-note-3-n9000-angry-tiger-endorphone.jpg" title="Стильные чехлы для вашего верного помощника endorphone.com.ua" width="248"></p>\r\n<p>Новейшие чехлы способны не только создать надёжную протекцию устройству, но также украсить его интересным изображением. Такие недорогие приспособления помогут любому владельцу Самсунг Галакси позаботиться о защите своего смартфона.</p>\r\n<h2>Стильный чехол &mdash; лучшее украшение</h2>\r\n<p>Все большую популярность набирают мобильные устройства Самсунг Галакси. Гаджеты обладают большим объёмом памяти, а улучшенный сенсор и частота процессора позволяют использовать его дольше. По причине незаменимости этих девайсов, остро стоит вопрос о том, чтобы приобретать чехлы на Самсунг исключительно высокого качества.</p>\r\n<p>Модели, представленные в этом каталоге, можно купить по стоимости, которая адаптирована к потенциальному покупателю такого приспособления. Цена на товары этой линейки колеблется в диапазоне от 159 до 190 гривен и может изменяться исключительно по рекомендации производителя.</p>\r\n<p>&nbsp;</p>\r\n<p>Чехлы на Самсунг, которые можно заказать в этом магазине, &mdash; ультратонкие и максимально удобные в использовании благодаря своей обтекающей форме, мягко закругленным углам и надежной фиксации на телефоне. Они полностью покрывают весь Галакси, чтобы обеспечить защиту от всевозможных повреждений.</p>\r\n<ul>\r\n	<li>чехол для телефона Samsung Galaxy обезопасит от сколов по бокам устройства;</li>\r\n	<li>приспособление избавит от появления царапин &mdash; самых неприятных последствий долгого использования;</li>\r\n	<li>если купить эту защитную оболочку, она защитит от чрезмерной влаги ваш телефон и не даст воде проникнуть внутрь девайса.</li>\r\n</ul>\r\n<p>Ещё одним преимуществом, которым обладает оригинальный чехол для телефона Самсунг, является его термостойкость. Это обеспечивает защиту от перегрева и существенно увеличивает срок эксплуатации аккумуляторной батареи.</p>\r\n<p>Термостойкость пластика, из&nbsp;которого изготовлены чехлы для телефонов, также защищает устройство от&nbsp;перегрева и&nbsp;продлевает срок эксплуатации батареи.<o:p></o:p></p>\r\n<p>Задняя панель чехла становится настоящим полотном для художника. Даже если вы&nbsp;не&nbsp;умеете рисовать, выбирайте любимое изображение или фото, и&nbsp;благодаря возможности индивидуального заказа создавайте абсолютно аутентичный дизайн. Огромный выбор чехлов по&nbsp;категориям позволяет оформить свой девайс всевозможными<span class="apple-converted-space">&nbsp;</span><a href="http://endorphone.com.ua/case/patterns">узорами</a><span class="apple-converted-space">&nbsp;</span>или замысловатыми<span class="apple-converted-space">&nbsp;</span><a href="http://endorphone.com.ua/case/abstractions">абстракциями</a>, а&nbsp;также героями мультипликаций и&nbsp;фильмов.<o:p></o:p></p>\r\n<h2>Почему необходимо выбирать исключительно качественные оболочки мобильных устройств?</h2>\r\n<p>В Украине всё чаще появляется эксклюзивный чехол для телефона Самсунг Galaxy, который завоевывает популярность среди покупателей отменным качеством. Купить или заказать защиту для своего Samsung будет гораздо дешевле, нежели оплатить ремонт телефона в случае его неисправности, поскольку стоимость чехла достаточно невысока.</p>\r\n<p>Если не хотите купить подделку, то осуществлять покупку нужно только в каталоге от брендового продавца. Наш интернет-магазин заслужил репутацию проверенного поставщика аксессуаров для фирменных девайсов.</p>\r\n<p>Защитные чехлы на Самсунг помогают обеспечить надёжную протекцию вашему устройству, чтобы в разы продлить срок его использования. Продажа этих аксессуаров на гаджеты Samsung с каждым годом увеличивается в своем объёме, и покупатели высоко оценивают её характеристики.</p>\r\n<p>Изысканный чехол для телефона Samsung Galaxy может стать не только украшением вашего устройства, но и отличным подарком, цена на который доступна всем слоям населения. Задняя панель может быть с любым рисунком: покупатель имеет возможность предложить своё изображение или же выбрать готовые варианты из каталога магазина.</p>\r\n<p>Все чехлы на телефон Самсунг Галакси обеспечили себе отменную репутацию благодаря производительности, долгому сроку службы и стильному дизайну. Такой полезный аксессуар для вашего мобильного устройства станет не только защитой, но и подчеркнёт индивидуальность обладателя гаджета.</p>'),
(7, 'Nokia', 'Нокиа', 'nokia', 'nokia-7.jpg', '', 0, 0, 14, 'Чехлы для Nokia: купить чехол на телефон Нокиа в интернет-магазине Endorphone', 'чехлы, на телефон, Nokia, аксессуары, Нокиа, для смартфона, интернет-магазин, endorphone', 'Качественные и модные чехлы для смартфонов Nokia выбирайте в магазине Endorphone. &#10004; Скидки за лайки! &#9992; Доставка по всей Украине  бесплатно при покупке двух чехлов.', 'Чехлы для Nokia', '<h2>Чехлы для телефонов Nokia</h2>\r\n<p>Nokia&nbsp;&mdash; одна из&nbsp;наилучших марок мобильных устройств. Эта корпорация уверенно стоит на&nbsp;ногах и&nbsp;радует все новыми и&nbsp;новыми моделями телефонов. Каждый гаджет имеет свои особенности и&nbsp;характеристики, а&nbsp;линейка смартфонов бренда в&nbsp;целом не&nbsp;похожа ни&nbsp;на&nbsp;одну другую. Nokia&nbsp;&mdash; фирма, которой можно доверять. Уже на&nbsp;протяжении многих лет она радует людей новинками мобильных устройств с&nbsp;разнообразными возможностями.</p>\r\n<h2>Украсьте свой смартфон Нокиа красивым чехлом</h2>\r\n<p>Каждый человек хочет уберечь свой смартфон от&nbsp;царапин, попадания воды и&nbsp;других повреждений, которые могут быть фатальными для устройства. С&nbsp;этой задачей прекрасно справится чехол. Он&nbsp;не&nbsp;только защитит, но&nbsp;и&nbsp;украсит телефон. Этот крутой аксессуар подчеркивает индивидуальность человека, показывает вкус и&nbsp;предпочтения владельца телефона.</p>\r\n<p>Если вы&nbsp;не&nbsp;хотите быть похожим на&nbsp;всех и&nbsp;иметь подобный всем чехол для телефона, обратитесь в&nbsp;интернет-магазин &laquo;Endorphone&raquo;. У&nbsp;нас вы&nbsp;сможете купить себе уникальный аксессуар для мобильного устройства. Удивите близких, друзей и&nbsp;товарищей своей покупкой, подтвердите свою оригинальность. В&nbsp;каталоге имеется неимоверное количество рисунков для чехлов:</p>\r\n<ul>\r\n<li><a href="http://endorphone.com.ua/silicone-case/art">арт</a>;</li>\r\n<li>цветы;</li>\r\n<li>космос;</li>\r\n<li>классика;</li>\r\n<li><a href="http://endorphone.com.ua/silicone-case/auto-moto">авто/мото</a>;</li>\r\n<li>узоры.</li>\r\n</ul>\r\n<p>Главное&nbsp;&mdash; в&nbsp;нашем магазине можно приобрести именной чехол. Вот та&nbsp;вещь, которая не&nbsp;оставит равнодушным никого. Такой экземпляр чехла будет точно единственным. Вы&nbsp;имеете возможность выбрать цвет фона аксессуара, текст (имя, фамилия), который будет на&nbsp;нем написан. </p>\r\n<h2>Покупайте у&nbsp;нас чехол&nbsp;&mdash; получайте аксессуар вашей мечты</h2>\r\n<p>Заказать такой аксессуар для своего смартфона может каждый в&nbsp;любое время в&nbsp;режиме онлайн. Все легко и&nbsp;просто. Покупайте чехол у&nbsp;нас&nbsp;&mdash; и&nbsp;получайте наилучшее качество. Наш магазин оснащен самым современным печатным оборудованием, поэтому картинка будет на&nbsp;сто процентов соответствовать тому, что вы&nbsp;закажете. Изготовление аксессуара производится очень быстро, отправка осуществляется в&nbsp;день заказ, если он&nbsp;был принят до&nbsp;14:00. Мы&nbsp;будем безгранично благодарны за&nbsp;то, что доверите нам работу над чехлом для вашего телефона.</p>'),
(8, 'HTC', 'ХТЦ', 'htc', 'htc-8.jpg', '', 0, 0, 3, 'Чехлы для HTC | Купить чехол для телефона НТС в интернет-магазине Endorphone', 'htc, чехол, аксессуар, endorphone, купить, стоимость, продажа, заказать, чехлы, телефон, мобильный, цена, стоимость', 'Качественные и модные чехлы для смартфонов HTC. Получи скидку за лайк! Доставка по всей Украине бесплатно при покупке двух чехлов на мобильный телефон HTC. Выбирай в интернет-магазине Endorphone.', 'Чехлы для HTC', '<h2>Надежные чехлы на страже инноваций HTC</h2>\r\n<img src="http://endorphone.com.ua/prod_foto/case-one-m8-girl-in-tattoos-v2-endorphone.jpg " width="230" height="211" alt="Надежные чехлы на страже инноваций HTC" title="Надежные чехлы на страже инноваций HTC endorphone.com.ua" align="left">\r\n<p>Смартфоны компании HTC зарекомендовали себя как устройства, гармонично сочетающие высокую производительность, приятный интерфейс и минималистический дизайн. Если производитель смартфонов HTC ориентирован на гармонию внешнего вида и функциональности, то чехлы, представленные в магазине Endorphone, не отстают и сочетают в себе надежность и эксклюзивный дизайн.</p>\r\n<h2>Защита телефона в самых разных условиях</h2>\r\n<p>Хотите подольше сохранить ощущение трепета перед телефоном, которое испытывали в первые дни после покупки? Не того нервозного трепета перед царапинами, потертостями и сколами, а именно наслаждения эстетикой невредимого и сияющего новизной девайса? Приобретайте сразу же качественные чехлы из термостойкого пластика на любую модель HTC и будьте спокойны за его сохранность. С надежными чехлами, даже спустя время, решив продать любимое устройство, вы не потеряете ни копейки за нетоварный вид.</p> \r\n<p>Высококачественный пластик обеспечит защиту вашего мобильного в самых разных условиях:</p>\r\n<ul>\r\n<li>при перегревах (от внутренней батареи или солнечных лучей);</li>\r\n<li>при попадании влаги;</li>\r\n<li>при падениях;</li>\r\n<li>при механическом воздействии.</li>\r\n</ul>\r\n<p>Так, состоящие в своем большинстве из мягких металлов корпуса смартфонов HTC в силу слабой амортизации очень неустойчивы к падениям и ударам, поэтому для таких моделей крайне важная защита с первых дней пользования.</p>\r\n<p>Кроме защиты корпуса устройства, ультратонкие чехлы от магазина Endorphone обеспечивают оригинальность вашего телефона. Дизайн, ориентированный на самые разные группы потребителей, представлен различными <a href="http://endorphone.com.ua/case/brands">брендами</a>, патриотической символикой Made in Ukraine, <a href="http://endorphone.com.ua/case/fun">прикольными</a> изображениями и другими категориями.</p>\r\n<h2>Оденьте своего любимца у нас</h2>\r\n<p>Приобретая в нашем магазине чехол для своего любимца, вы имеете возможность создать абсолютно неповторимый дизайн на основе индивидуального заказа или выбрать из множеств уже существующих. Нашим клиентам также предлагается бесплатная доставка при покупке от 2-х единиц товаров по Киеву и всей Украине. Чтобы купить полюбившийся чехол по выгодной цене, достаточно оплатить картой или наложенным платежом при получении на «Новой почте» или «Укрпочте».</p>'),
(9, 'LG', 'ЛГ', 'lg', 'lg-9.jpg', '', 0, 0, 5, 'Чехлы для телефонов LG | Купить чехол на LG в интернет-магазине Endorphone', 'lg, чехол, аксессуар, чехол lg, для телефона, смартфона, купить, цена, стоимость, продажа, недорого, заказать, интернет магазине, endorphone', 'Только качественные чехлы для LG! Закажи чехол для телефона Лджи с бесплатной доставкой по всей Украине. Получи скидку за лайк.', 'Чехлы для телефонов LG', '<p><img align="left" alt="Ультратонкий и ультранадежный чехол для LG" class="mCS_img_loaded" height="211" src="http://endorphone.com.ua/prod_foto/case-g2-ejik-v-kosmose-endorphone.jpg " title="Ультратонкий и ультранадежный чехол для LG endorphone.com.ua" width="241"></p>\r\n<p>Компания LG на протяжении семи десятков лет радует нас новинками электронной и бытовой техники. Фирма получила признание не только в Южной Корее, но и в западных странах. Популярность бренда подтверждает общеизвестность мобильного &laquo;ЛДжи&raquo;. При таком раскладе чехлы для телефона LG окажутся не менее актуальными.</p>\r\n<p>Главный аргумент в пользу приобретения аксессуара &mdash; надёжная защита девайса от повреждений. При этом учитываются случайные падения на землю, появление царапин и сколов. С фирменной накладкой устройству не страшны ни серьёзные поломки, ни мелкие дефекты.</p>\r\n<h2>Мир защитных атрибутов</h2>\r\n<p>Если вам нужен чехол на LG, будьте осторожны. На нашем сайте представлен широкий ассортимент товаров, и запутаться в них достаточно легко. Существуют недорогие, но при этом качественные и надёжные модели. Есть эксклюзивные чехлы, цена на которые доступна для немногих. Защитные средства для телефонов различаются по стилям:</p>\r\n<ol>\r\n	<li style="margin-left: 54pt;">Спортивный. Поклонники футбола, хоккея украшают заднюю панель устройства эмблемами любимых клубов, оформляют заказ на печать фотографий Роналду, Месси. Цена на это защитное изделие обычно невелика.</li>\r\n	<li style="margin-left: 54pt;">С героями мультфильмов. Такой чехол на LG подойдёт школьнику, но среди представителей старшего поколения найдутся молодые душой люди, которые оценят смешные изображения Миньонов или Пупырки.</li>\r\n	<li style="margin-left: 54pt;">Уникальный. Наши мастера создают изысканные рисунки по индивидуальным эскизам и фотографиям клиентов. То, что изготовим мы, вы не встретите больше нигде.</li>\r\n</ol>\r\n<p>У нас вы можете приобрести как один чехол для LG, так и целую коллекцию. Есть три главные причины начать скупать защитные средства из нашего магазина:</p>\r\n<ol>\r\n	<li>Цена на один аксессуар не особо отличается от стоимости нескольких штук.</li>\r\n	<li>С нами можно не только защитить телефон, но и подобрать дизайн под настроение. Раз уж цена на чехлы ниже, чем стоимость билетов на Багамы &mdash; украсьте устройство картинками пляжа.</li>\r\n	<li>Защита будет очень даже кстати, если вы соберётесь продавать или менять гаджет. Техника должна выглядеть презентабельно, ведь от этого её стоимость только увеличится.</li>\r\n</ol>\r\n<p>Нельзя купить чехлы для телефона LG, которые давали бы стопроцентную безопасность, однако защитить аппарат от пыли и влаги тоже важно. У нас вы можете заказать красиво оформленные аксессуары и получить ещё и дополнительные заставки, подходящие по стилю к общему оформлению устройства.</p>\r\n<h2>Ассортимент</h2>\r\n<p>Интернет-магазин предлагает не только чехлы для телефона LG, но и оригинальный дизайн. При взаимодействии изделия с мобильным телефоном не возникнет никаких проблем &mdash; в нём есть вырезы, которые предоставляют свободный доступ к кнопкам, камере и разъёмам аппарата. Другой повод купить аксессуар именно у нас &mdash; высокое качество чехла.</p>\r\n<p>Продажа и доставка товаров осуществляется по всей территории Украины. Вы можете купить чехлы для&raquo; ЛДжи&raquo;, оплатив покупку наиболее удобным для вас способом. Удобный интерфейс сайта поможет найти аксессуар, подходящий под определённые параметры. Заказ доставят точно в срок.</p>\r\n<p>Покупателям предлагается продукция, выполненная исключительно из высококачественных материалов. На сайте размещены описания моделей, вы также можете ознакомиться с условиями доставки, сравнить стоимость. Купить чехол для телефона &laquo;ЛДжи&raquo; через интернет-магазин можно очень удобно и просто!</p>\r\n<p>Хочется чего-то особенного? Предлагаем создать и заказать&nbsp;<span class="apple-converted-space"><a href="http://personalcase.endorphone.com.ua/">именной чехол</a>. Это простой и популярный способ самовыразиться.</span></p>'),
(10, 'Sony', 'Сони', 'sony', 'sony-10.jpg', '', 0, 0, 6, 'Чехол для Сони (Sony)| Покупай чехол для телефона Сони в интернет-магазине Endorphone', 'sony, чехол, аксессуар, endorphone', 'Качество, уникальность и стиль в чехлах для телефонов Sony! Чехол Sony c бесплатной доставкой по всей Украине. Скидки на чехлы за лайк.', 'Чехол для Сони (Sony)', '<h2>Эксклюзивный дизайн чехлов для Sony</h2>\r\n<p><img align="left" alt="Эксклюзивный дизайн чехлов для Sony" height="211" src="http://endorphone.com.ua/prod_foto/case-xperia-z1-c6902-peder-mork-monsted--spokoynyy-prud-endorphone.jpg" title="Эксклюзивный дизайн чехлов для Sony endorphone.com.ua" width="241"></p>\r\n<p>Современные мобильные телефоны &ndash; это не только средство для связи с близкими людьми. Они предоставляют массу возможностей: прослушивание музыки, просмотр фильмов, общение, различные игры и так далее. Постоянная эксплуатация устройства может привести в лучшем случае к появлению царапин, а в худшем &ndash; к поломке смартфона без возможности восстановления. Любому пользователю хочется максимально защитить своего мобильного &laquo;друга&raquo; и помощника. С этой задачей справится чехол для Sony. Облачив смартфон в качественный, но при этом недорогой бампер, вы можете быть уверены в его сохранности.</p>\r\n<h2>Купить или нет?</h2>\r\n<p>Несмотря на то что производитель мобильных телефонов &laquo;Сони&raquo; гарантирует удивительную стойкость своей продукции к любым испытаниям в ходе ежедневного использования, от мелких повреждений, которые могут спровоцировать большую проблему, не застрахован ни один из аппаратов. Насколько бы ни был аккуратен владелец, телефон всё равно падает (причём иногда он может очутиться на полу, если был поставлен в режим вибрации и просто лежал на краю стола), царапается в том же кармане и так далее.</p>\r\n<p>Что уж говорить о тех людях, для кого бросить гаджет в сумку с ключами обыденное дело? На вопрос: &laquo;Стоит ли купить чехол для телефона &laquo;Сони&raquo;?&raquo; ответ очевиден &ndash; &laquo;Да!&raquo;.</p>\r\n<h2>Оригинальный дизайн</h2>\r\n<p>Чехлы для &laquo;Сони&raquo;, представленные в розничных магазинах любого города, уже никого не удивляют и не поражают. Всевозможные герои мультфильмов десятилетней давности, типичные кошечки-собачки и классические абстракции уже давно всем надоели. Мы предлагаем клиентам купить интересные чехлы для смартфона на различные тематики:</p>\r\n<ul>\r\n	<li>животный мир;</li>\r\n	<li>космос;</li>\r\n	<li>изысканные абстракции;</li>\r\n	<li>знаменитости;</li>\r\n	<li>герои современных мультфильмов;</li>\r\n	<li>оригинальные надписи, фразы и многое другое.</li>\r\n</ul>\r\n<p>Также в ассортименте представлены текстурные чехлы для &laquo;Сони&raquo; и классические бамперы без украшений.</p>\r\n<h2>Для тех, кто хочет быть неповторимым</h2>\r\n<p>Если вы желаете купить эксклюзивный аксессуар, аналогов которому не найдётся больше нигде, мы предлагаем сделать заказ по индивидуальным эскизам. Более того, благодаря конструктору можете создать себе чехол сами. Сделать это удобно прямо на нашем сайте. Если у вас уже есть наготове изображение, можете посмотреть в режиме онлайн, как будет выглядеть чехол на смартфон &laquo;Сони&raquo;.</p>\r\n<p>Ещё одно преимущество индивидуального заказа аксессуара по собственному эскизу &ndash; доступная цена. За сравнительно невысокую стоимость вы получаете единственный в своём роде бампер, аналогов которого не встретите ни у кого.</p>\r\n<p>Причины, по которым стоит купить чехол для Sony у нас:</p>\r\n<ul>\r\n	<li>широкий ассортимент, удовлетворит запросы даже самого требовательного покупателя;</li>\r\n	<li>отличное качество;</li>\r\n	<li>возможность сделать индивидуальный заказ по своим эскизам;</li>\r\n	<li>невысокая цена на большинство видов товара;</li>\r\n	<li>разнообразие вариантов для каждой из моделей &laquo;Сони&raquo;;</li>\r\n	<li>возможность рассчитать стоимость заказа с помощью онлайн-калькулятора;</li>\r\n	<li>прямая продажа чехлов Sony без посредников;</li>\r\n	<li>одинаковая цена для устройств и старых, и новых моделей.</li>\r\n</ul>\r\n<p>Наш интернет-магазин в Украине предлагает заказать чехлы для &laquo;Сони&raquo;, которые не померкнут даже от прямых солнечных лучей, будут долго и надёжно защищать вашего мобильного &laquo;друга&raquo; и радовать владельца своим дизайном. Невысокая цена делает защиту для телефонов доступной для всех. Будьте уникальны с Endorphone.</p>\r\n<h2>Бережная защита вашего смартфона</h2>\r\n<p>Последние смартфоны компании Сони позиционируют себя как сверхпрочные и&nbsp;водонепроницаемые и&nbsp;даже заявлено, что смогут выдержать любые испытания, приготовленные жизнью. Но&nbsp;не&nbsp;стоит полностью полагаться на&nbsp;свою аккуратность, ведь активное использование гаджета в&nbsp;течении дня через некоторое время ведет к&nbsp;появлению маленьких, но&nbsp;заметных при ближайшем рассмотрении неприятностей.</p>\r\n<p>Чехлы, предложенные в&nbsp;нашем магазине, отличаются не&nbsp;только надежностью, но&nbsp;еще и&nbsp;эксклюзивным дизайном. Чтобы правильно подобрать чехол, перейдите на&nbsp;страницу своей модели смартфона Sony и&nbsp;подберите по&nbsp;своему вкусу вариант оформления. К&nbsp;вашим услугам несколько десятков категорий&nbsp;&mdash; от&nbsp;различных текстур, изображений&nbsp;<a href="http://endorphone.com.ua/case/space">космоса</a>&nbsp;и&nbsp;абстракций до&nbsp;изображений тематики для взрослых&nbsp;<a href="http://endorphone.com.ua/case/full-age">18+</a>.</p>'),
(11, 'Huawei', 'Хуавей', 'huawei', 'huawei-11.jpg', '', 0, 0, 11, 'Купить чехлы на Huawei в Украине | endorphone.com.ua', 'чехлы на huawei, чехлы на хуавей, чехлы для huawei, чехол для huawei, купить, цена, стоимость, продажа, недорого, Украина, интернет магазин, Эндорфон', 'Чехлы на хуавей - быстрая доставка, отличное качество, недорого. Предлагаем купить чехол для Huawei с доставкой по всей Украине. Звоните &#9743; 044 393 40 31', 'Чехлы на Huawei', '<p><img align="left" alt="Чехлы для стильных и уверенных в себе" height="211" src="http://endorphone.com.ua/prod_foto/case-p6-the-walking-dead-1-endorphone.jpg" title="Чехлы для стильных и уверенных в себе endorphone.com.ua" width="233"></p>\r\n<p>Интернет-магазин предлагает купить резиновый чехол для Huawei. Нами осуществляется продажа качественных товаров для всей семьи. Оригинальные модели подойдут по стилю и жизненной позиции человеку любого возраста.</p>\r\n<h2>Представителям сильного пола</h2>\r\n<p>Для защиты своего мобильного &laquo;друга&raquo; следует обязательно купить резиновый чехол для Huawei. В Украине эта модель смартфонов пользуется особенной популярностью у мужчин. Более ста вариантов чехлов представлены на выбор покупателей. Их можно разделить на группы, в зависимости от изображения на поверхности:</p>\r\n<ul>\r\n	<li>животные и монстры. Присутствие благородной лошади или сильного волка укажет на особенности вашего характера, изображение чудища подчеркнёт нестандартный вкус;</li>\r\n	<li>машины. Такой чехол для мобильного телефона может выбрать как автолюбитель, так и человек соответствующей профессии;</li>\r\n	<li>герои компьютерных игр. Изделия с присутствием определённого персонажа укажут на ваши увлечения и, может даже, на уровень в виртуальном мире;</li>\r\n	<li>спортивная символика. Чехлы на Huawei подойдут поклоннику того или иного бренда и человеку, который ведёт здоровый образ жизни;</li>\r\n	<li>сексуальные девушки. Изображение станет хорошим дополнением для смартфона и поднимет настроение его владельцу.</li>\r\n</ul>\r\n<p style="margin-left:18.0pt;">И&nbsp;хотя основной заботой этих аксессуаров является именно сохранность девайса, притязательность пользователей и&nbsp;стремление выделяться дает импульс производителям чехлов создавать все более разнообразные модели. А&nbsp;многообразие их&nbsp;поистине безгранично. Вы&nbsp;сможете выбрать любой из&nbsp;предложенных вариантов оформлений, начиная с&nbsp;приятных визуализаций&nbsp;<a href="http://endorphone.com.ua/case/textures">текстур</a>&nbsp;заканчивая изображениями из&nbsp;любимых&nbsp;<a href="http://endorphone.com.ua/case/serial">сериалов</a>.</p>\r\n<p>&nbsp;</p>\r\n<p>Кроме указанных моделей, у нас можно заказать чехлы на &laquo;Хуавей&raquo; с присутствием спокойного узора или динамичного рисунка.</p>\r\n<h2>Для женщин</h2>\r\n<p>Реализуются оригинальные варианты для представительниц прекрасного пола:</p>\r\n<ul>\r\n	<li>цветы. У нас можно купить чехол с изображением лилий, роз, пионов, ромашек, сирени, маков;</li>\r\n	<li>девушки. Присутствие на телефоне картинки, на которой нарисована современная модная барышня, будет напоминать владелице о её красоте и молодости;</li>\r\n	<li>животные. Резиновые чехлы на &laquo;Хуавей&raquo; с изображением милых котиков и собачек способны вызвать самые тёплые эмоции;</li>\r\n	<li>вкусности. Модели отличаются присутствием лакомых десертных композиций, которые так и хочется съесть.</li>\r\n</ul>\r\n<p>Также есть возможность заказать чехлы на Huawei с абстрактными изображениями, выполненными в пастельных оттенках.</p>\r\n<h2>Для юных клиентов</h2>\r\n<p>Подобрать резиновый чехол для мобильного телефона своего ребёнка несложно, для этого достаточно просмотреть предложенные варианты. Учитывая разнообразие товаров, вы не уйдёте с нашего сайта без покупки. У нас представлены чехлы на Huawei с картинками различных героев мультфильмов. Милая пони обязательно понравится юной леди, а смелый Спайдермен станет хорошим выбором для мальчика. Можно купить аксессуар с изображением любимых пушистых зверьков.</p>\r\n<p>Закажите для смартфона Huawei понравившийся вариант и оплатите его удобным способом. Доставка осуществляется в любые города Украины, что даёт возможность пользоваться качественными аксессуарами всем жителям страны.&nbsp;</p>'),
(12, 'Lenovo', 'Леново', 'lenovo', 'lenovo-12.jpg', '', 0, 0, 4, 'Чехлы на Леново, Lenovo | Купить чехол для телефона Леново в интернет-магазине Endorphone', 'lenovo, чехол, аксессуар, endorphone, интернет-магазин, купить, стоимость, продажа, заказать, чехлы, телефон, мобильный, цена, стоимость', 'Уникальные чехлы для Lenovo сделают тебя особенным! Бесплатная доставка чехлов для для Леново по всей Украине. Получи скидку за лайк.', 'Чехлы на Леново (Lenovo)', '<p><img align="left" alt="Стильные чехлы для мощных и удобных смартфонов Lenovo" class="mCS_img_loaded" height="211" src="http://endorphone.com.ua/prod_foto/case-a820-star-wars-endorphone.jpg" title="Стильные чехлы для мощных и удобных смартфонов Lenovo endorphone.com.ua" width="244"></p>\r\n<p>Хотите надолго сохранить первоначальный вид своего смартфона, защитить его от царапин и сколов? В интернет-магазине Endorphone можно купить оригинальные чехлы на &laquo;Леново&raquo; по цене от 169 грн, которые отлично справятся с этой задачей. Позаботьтесь о том, чтобы ваш мобильный телефон всегда выглядел аккуратно и надолго сохранил свою работоспособность.</p>\r\n<h2>Надёжная защита</h2>\r\n<p>У нас вы сможете приобрести недорогой, но при этом отличающийся высоким качеством чехол. Устройства фирмы Lenovo пользуются большой популярностью среди людей всех поколений, и Украина является одним из лидеров по использованию девайсов этой марки. Однако даже смартфоны премиальной линейки, выполненные из металла и стекла (не говоря уже о более бюджетных вариантах из пластика), не могут противостоять воздействию окружающей среды. Чтобы уберечь любимое устройство, можно купить чехол для телефона &laquo;Леново&raquo;. Его стоимость будет существенно ниже, чем цена на новый корпус или экран.</p>\r\n<p>Чехлы для смартфонов Lenovo способны надёжно защитить устройство от потёртостей, мелких царапин и сколов. Даже через несколько лет ваш телефон будет выглядеть как новенький. Чехлы для Lenovo, продажа которых осуществляется в интернет-магазине Endorphone, являются не только надёжными, но и практичными. Они выполнены из ультратонкого термоустойчивого пластика, который характеризуется эргономичностью. Представленные на нашем сайте чехлы на &laquo;Леново&raquo; очень плотно прилегают, что гарантирует комфортное использование. Специальный дизайн, разработанный с учётом особенностей каждой модели, обеспечивает свободный доступ ко всем кнопкам и разъёмам.</p>\r\n<p>Большинство покупателей отдают предпочтение именно силикону, ведь он износоустойчивый, практичный и стильный. Этот материал как нельзя лучше позволяет защитить девайс от повреждений во время падений. Чехлы для Lenovo из силикона амортизируют удар, как бы отпружинивая от поверхности. Теперь можно не бояться давать свой девайс маленьким детям, опасаясь, что тот выпадет из рук.</p>\r\n<h2>Самовыражение</h2>\r\n<p>Чехол &mdash; многофункциональный предмет, который способен как защитить ваш &laquo;Леново&raquo; от повреждений, так и скрыть уже имеющиеся на корпусе царапины и сколы. Для этого можно заказать обычный бампер &mdash; под цвет вашего мобильного телефона. Для многих выбирающих чехол людей эстетический фактор находится на первом месте. Покупка красивого чехла &mdash; простой и доступный способ сделать свой мобильный не только средством связи, но и стильным аксессуаром.</p>\r\n<p>Если вы хотите выделиться из толпы и сделать свой смартфон оригинальным и неповторимым, то наш интернет-магазин поможет это сделать. Сегодня задняя панель стала отличной площадкой для самовыражения или даже рекламы. На сайте осуществляется продажа бамперов, выполненных в самых разных стилях. У нас можно купить как изысканные готовые чехлы на &laquo;Леново&raquo;, так и заказать эксклюзивные или именные изделия. Цена на обычные бамперы стартует от 169 гривен, выполненные по индивидуальному дизайну &mdash; от двухсот. Стоимость, описание и характеристики указаны на страничке товара. Благодаря Endorphone купить чехол, который выполнили по индивидуальному дизайну, можно легко и просто. На доставку товара уходит от 1 до 3 дней.</p>\r\n<p>Чтобы подобрать подходящий чехол, выберите модель вашего мобильного телефона. В каталоге представлено более тысячи товаров, которые для удобного поиска разделены на категории. Быстро найти нужный вариант позволяет установленная на сайте система фильтров по тематике и расцветке. Доступны следующие категории:</p>\r\n<ul>\r\n	<li>абстракции;</li>\r\n	<li>аниме;</li>\r\n	<li>арт;</li>\r\n	<li>цветы;</li>\r\n	<li>космос;</li>\r\n	<li>животные;</li>\r\n	<li>бренды;</li>\r\n	<li>классика;</li>\r\n	<li>мультфильмы;</li>\r\n	<li>авто/мото;</li>\r\n	<li>спорт;</li>\r\n	<li>фильмы/сериалы;</li>\r\n	<li>музыка;</li>\r\n	<li>узоры;</li>\r\n	<li>флаги и гербы;</li>\r\n	<li>18+ и др.</li>\r\n</ul>\r\n<p>Широкий ассортимент позволит совершить покупку даже самым взыскательным и требовательным клиентам. Купить понравившийся чехол можно прямо на сайте, также вы можете оформить заказ по телефону. В зависимости от модели смартфона доступны модели из силикона (0,3 мм), матового и глянцевого пластика (0,9 мм). Узнать подробную информацию или проконсультироваться, уточнить цены можно в телефонном режиме.</p>\r\n<p>Хочется чего-то особенного? Предлагаем создать и заказать&nbsp;<span class="apple-converted-space"><a href="http://personalcase.endorphone.com.ua/">именной чехол</a>. Это простой и популярный способ самовыразиться.</span></p>'),
(13, 'Motorola', 'Моторола', 'motorola', 'motorola-13.jpg', '', 0, 0, 10, 'Купить чехол для Motorola в Украине | endorphone.com.ua', 'купить чехол для motorola, купить чехлы для моторола, купить чехол для motorola в украине, купить чехлы на motorola в украине, купить, цена, стоимость, продажа, недорого, Украина, интернет магазин, Эндорфон', 'Предлагаем купить чехлы для моторола по доступной цене. Заказать чехол на моторола с доставкой по всей Украине. Звоните &#9743; 044 393 40 31.', 'Купить чехлы для моторола', '<p><img align="center" alt="Чехлы на Motorola Nexus 6" src="http://endorphone.com.ua/prod_foto/case-nexus-6-ponchiki-25-endorphone.jpg" style="margin: 0px 15px 0px 0px; float: left;" title="Чехлы на Motorola Nexus 6 - Endorphone" width="200"></p>\r\n<h2>Выбор чехлов для смартфона Motorola Nexus 6</h2>\r\n<p>Интернет-магазин Endorphone с радостью поможет украсить любой мобильный телефон торговой марки &laquo;Моторола&raquo;, сделать его ярким и современным. Обширный каталог нашего интернет-магазина не оставит никого равнодушным, ведь он содержит много разделов разнообразной тематики &mdash; изображения животного мира, техники, цветов, украинской символики, знаменитостей. Вам остаётся лишь выбрать и купить чехол Motorola &ndash; модный и уникальный аксессуар, с желаемыми принтами.</p>\r\n<h2>Укрась свой смартфон</h2>\r\n<p>Как сделать свой телефон ещё более стильным, и при этом защитить его от пыли, механических ударов, царапин и сохранить внешний вид как можно дольше? Чехол для Motorola &ndash; вот он, ваш стильный аксессуар и надёжный помощник.</p>\r\n<p>Соотношение цена/качество &mdash; главный козырь ассортимента нашего магазина. Стоимость чехла на мобильный телефон станет дополнительной радостью при его покупке. Ведь цены у нас &ndash; это сплошная радость. В Украине нигде больше вы не найдёте дешевле.</p>\r\n<p>Силиконовый и резиновый, однотонный и с рисунком &ndash; выбирайте любой и наслаждайтесь купленным товаром! Вся наша продукция отличается отменным качеством и прослужит вам не один год.</p>\r\n<p>Также мы рады вам предложить чехлы для разных моделей &laquo;Моторола&raquo;: Nexus 6, Moto G3 и Moto G2. А если вам не приглянется ничего из выше предложенных изображений, вы можете заказать индивидуальный чехол для &laquo;Моторола&raquo; со своим именем, фамилией и любой другой надписью. И тогда вы точно не останетесь без внимания!</p>\r\n<h2>Незамысловатая процедура покупки</h2>\r\n<p>Чтобы примерить новенький недорогой чехол на &laquo;Моторола&raquo; от компании Endorphone, нужно всего-то сделать три шага:</p>\r\n<ul>\r\n	<li>оформить заказ;</li>\r\n	<li>подтвердить покупку;</li>\r\n	<li>оплатить стоимость аксессуара.</li>\r\n</ul>\r\n<p>Заказать недорогие чехлы для Motorola вы можете здесь и сейчас, и на протяжении 1&ndash;2 дней вам его доставят &laquo;Новой Почтой&raquo;. Оплатить покупку можно как переводом на банковскую карту, так и непосредственно после получения товара.</p>\r\n<p>Компания предлагает аксессуары не&nbsp;только для телефонов Motorola. Lenovo,&nbsp;<a href="http://endorphone.com.ua/htc-one-x-case">HTC One X</a>,&nbsp;<a href="http://endorphone.com.ua/samsung-galaxy-s2-plus-i9105-case">Samsung Galaxy S2</a>, S3, S4, S5&nbsp;и&nbsp;другие популярные модели смартфонов будут выглядеть эстетично и&nbsp;интересно в&nbsp;чехлах от&nbsp;Endorphone.</p>\r\n<p>Защитите свой смартфон вместе с Endorphone!&nbsp;</p>'),
(14, 'Asus', 'Асус', 'asus', 'asus-14.jpg', '', 0, 0, 12, 'Купить силиконовый чехол на Asus в Украине | endorphone.com.ua', 'силиконовый чехол на asus, силиконовый чехол на асус, купить силиконовый чехол для asus, купить резиновый чехол для asus, купить, цена, стоимость, продажа, недорого, Украина, интернет магазин, Эндорфон', 'Купить резиновый чехол для Asus по доступной цене. Предлагаем заказать силиконовый чехол для асус с доставкой по всей Украине. Звоните &#9743; 044 393 40 31.', 'Чехлы на Asus', '<h2>Чехлы для телефонов Asus</h2>\r\n<p><img align="left" alt="Чехлы для Asus - Endorphone" hspace="20" src="http://endorphone.com.ua/img/asus-case.jpg" title="Чехлы для Asus" width="200"></p>\r\n<p>Компания Asus зарекомендовала себя на рынке как надёжный производитель качественных мобильных телефонов. Продажа смартфонов в Украине указанного бренда увеличивается с каждым днём, поскольку девайсы характеризуются не только многофункциональностью, но и особым стилем в дизайне. Мобильный телефон отличается изящностью и элегантностью, поэтому купить силиконовый чехол на Asus &mdash; первое, что нужно сделать после приобретения устройства.</p>\r\n<h2>Особенности ассортимента</h2>\r\n<p>В каталоге интернет-магазина представлены силиконовые аксессуары для смартфона указанного бренда в оригинальном дизайне. Резиновый чехол для Asus оформлен цветочными мотивами, моделями шикарных иномарок авто, интересными орнаментами, милыми животными, патриотической атрибутикой.</p>\r\n<p>Купить силиконовый аксессуар для &laquo;Асус&raquo; в интернет-магазине можно и с эксклюзивным дизайном &mdash; именные изделия или модели с собственным фото. Цена такой &laquo;защиты&raquo; стартует от 199 грн.</p>\r\n<h2>Несколько слов о качестве</h2>\r\n<p>Силиконовый чехол на Asus толщиной в 3 мм характеризуется рядом преимуществ:</p>\r\n<ul>\r\n	<li>выполнен строго по размерам смартфона;</li>\r\n	<li>плотно облегает корпус устройства, не оставляя зазоров и не позволяя пыли скапливаться под ним;</li>\r\n	<li>&nbsp;не ограничивает доступ к динамикам, разъёмам, кнопкам, камере;</li>\r\n	<li>не деформируется под воздействием низких температур;</li>\r\n	<li>устойчив к ультрафиолету;</li>\r\n	<li>не теряет форму при частом снимании/одевании на мобильный телефон.</li>\r\n</ul>\r\n<p>Силиконовый чехол на &laquo;Асус&raquo; отличается качественным ярким оформлением. Изображения не выгорают на солнце, поэтому аксессуар сохраняет свою привлекательность на протяжении длительного времени.</p>\r\n<p>В&nbsp;нашем каталоге представлены чехлы на&nbsp;любой вкус: с&nbsp;<a href="http://endorphone.com.ua/silicone-case/flags">флагами</a>&nbsp;разных стран, красивыми абстракциями, милыми&nbsp;<a href="http://endorphone.com.ua/silicone-case/animals">животными</a>&nbsp;и&nbsp;т.&nbsp;д. Выбор есть для всех: для детей, девушек и&nbsp;парней, женщин и&nbsp;мужчин.</p>\r\n<h2>Мы работаем для вас!</h2>\r\n<p>Интернет-магазин предлагает купить силиконовый чехол на Asus недорого, по привлекательной цене. Стоимость изделия &mdash; 169 грн. К каждой покупке обязательно прилагается эксклюзивный подарок &mdash; заставка на рабочий стол смартфона, идентичная изображению на аксессуаре.</p>\r\n<p>Оперативная доставка, качественное обслуживание, консультации &mdash; всё это предлагаем каждому клиенту. Заказы принимаем круглосуточно, оформляем покупку в рабочие часы.</p>'),
(15, 'Xiaomi', 'Сяоми', 'xiaomi', 'xiaomi-15.jpg', '', 0, 0, 8, 'Чехол на Xiaomi: купить чехлы на телефоны Xiaomi в интернет магазине Endorphone', 'чехлы, на телефон, xiaomi, аксессуары, сяоми, для смартфона, интернет-магазин, endorphone, купить, стоимость, продажа, заказать, телефон, мобильный, цена, стоимость', 'Качественные и модные чехлы для смартфонов Xiaomi выбирайте в магазине Endorphone. &#10004; Скидки за лайки! &#9992; Доставка по всей Украине бесплатно при покупке двух чехлов.', 'Чехол на Xiaomi', '<p>Обезопасить смартфон можно с помощью современных аксессуаров. Чехол на Xiaomi – классное приспособление, которое совмещает в себе полезную функцию по защите мобильного и придает устройству отличный внешний вид.</p>\r\n<h2>Предназначение</h2>\r\n<p>Подобные аксессуары успешно вышли на рынок мобильных технологий и не первый год доказывают, что обеспечивают безопасность гаджетам. Даже если вы стараетесь аккуратно обращаться с телефоном, появления потертостей не избежать. Поэтому следует купить этот аксессуар по недорогой стоимости в нашем интернет-магазине, доставка осуществляется по всей территории Украины.</p>\r\n<p>Продукция создается с учетом всех норм и стандартов. Уникальные технологии позволяют добиться нанесения такого качества изображения, которое останется ярким на протяжении длительного времени. Защитить дисплей мобильного поможет специальная пленка. Ассортимент изысканной и эксклюзивной продукции доступен для выбора в каталогах нашего сайта. Любую модель по оптимальной цене можно купить буквально за несколько минут.</p>\r\n<h2>Ассортимент</h2>\r\n<p>Хитом продаж, сегодня являются чехлы для телефонов Xiaomi, созданные по авторскому дизайну. Аксессуар передаст ваш стиль, а устройство будет выгодно выделяться на фоне однотипных гаджетов. Особое внимание на защитные чехлы следует обратить тем, кто активно использует телефон. Ведь царапины, трещины и сколы – неизменные спутники повседневной рутины, проявление которых можно заметить не сразу.</p>\r\n<p>Чехлы для «Ксиаоми» очень популярны на рынке, наш интернет-ресурс вмещает в себя только лучшие варианты оригинальной продукции. Купить желаемую модель по выгодной цене можно в здесь.</p>\r\n<h2>Преимущества продукции</h2>\r\n<p>Силиконовые чехлы для Xiaomi захватил популярность благодаря:</p>\r\n<ul>\r\n	<li style="margin-left: 36pt;">приятному на ощупь материалу;</li>\r\n	<li style="margin-left: 36pt;">отменному дизайну;</li>\r\n	<li style="margin-left: 36pt;">демократичной стоимости;</li>\r\n	<li style="margin-left: 36pt;">простоте в использовании.</li>\r\n</ul>\r\n<p>В процессе эксплуатации чехла на Xiaomi вы убедитесь, что данный аксессуар отлично прилегает к поверхности смартфона, защищая все стыки от попадания пыли и влаги, легко моется и придает устройству опрятный вид.</p>\r\n<p>Мы предоставляем нашим клиентам:</p>\r\n<ul>\r\n	<li style="margin-left: 36pt;">качественную продукцию;</li>\r\n	<li style="margin-left: 36pt;">консультации от специалистов;</li>\r\n	<li style="margin-left: 36pt;">внушительный ассортимент;</li>\r\n	<li style="margin-left: 36pt;">оптимальную цену;</li>\r\n	<li style="margin-left: 36pt;">оперативную доставку.</li>\r\n</ul>\r\n<p>Если вы успели заказать товар до 14:00, мы отправим его в тот же день.</p>\r\n<p>Ассортимент нашего интернет-магазина обновляется регулярно. Защиту гаджета усилит специальная пленка для экрана, которая обезопасит его от царапин на дисплее и составит удачную партию чехлу для Xiaomi.</p>\r\n<p>Если вы заинтересованы, чтобы ваш телефон прослужил долго – необходимо создать благоприятные условия для его защиты благодаря покупке чехла на Xiaomi.</p>');
INSERT INTO `catalog_brend` (`brendID`, `name`, `name_ru`, `folder`, `logo`, `rus`, `ratio`, `arh`, `sort`, `title`, `keyword`, `description`, `h1t`, `descr`) VALUES
(16, 'Meizu', 'Мейзу', 'meizu', 'meizu-16.jpg', '', 0, 0, 7, 'Чехлы для Мейзу в Украине. Купить чехлы на Meizu в интернет-магазине Endorphone', 'чехлы, на телефон, мeizu, аксессуары, мейзу, для смартфона, интернет-магазин, endorphone', 'Выбирайте в магазине Endorphone качественный и модный чехол для Meizu. &#10004; Скидки за лайки! &#9992; Доставка чехлов на телефон Meizu по всей Украине бесплатно при покупке двух чехлов.', 'Чехлы для Мейзу', '<h2>Чехлы для телефонов Meizu</h2>\r\n<p><img align="left" alt="Чехлы для Meizu - Endorphone" hspace="20" src="http://endorphone.com.ua/img/meizu-case.jpg" title="Чехлы для Meizu" width="200"></p>\r\n<p>Смартфон &ndash; неотъемлемая часть нашей жизни. Его используют не только для звонков, но и в качестве плеера, телевизора, приставки, книги и так далее. Разнообразие моделей настолько велико, что часто сложно определиться с выбором. Однако насколько бы прочным и надёжным ни был телефон, он нуждается в хорошей защите. Мы предлагаем купить лучшие чехлы для &laquo;Мейзу&raquo;, которые не только препятствуют возможным повреждениям вследствие ударов, но радуют глаз и стоят недорого. Пролистав наш ассортимент, убедитесь в этом сами!</p>\r\n<h2>Уникальные чехлы для вашего мобильного телефона</h2>\r\n<p>Вам наскучили однотипные чехлы для телефонов Meizu с популярными картинками? Хочется чего-то нового и невиданного. Только на нашем сайте у вас есть отличная возможность заказать чехол на телефон &laquo;Мейзу&raquo; по индивидуальному эскизу. Можете подобрать картинку в интернете, сделать коллаж, выбрать виды природы, фотографию семьи или дорогих людей &ndash; выбор безграничен. Хотите нарисовать всё сами? Пожалуйста! Мы воплотим в жизнь любую идею создания эксклюзивного и оригинального бампера для смартфона. Стоимость заказа по индивидуальному эскизу доступна для всех &ndash; цена радует клиентов.</p>\r\n<p>Преимущества совершения покупки у нас:</p>\r\n<ol>\r\n	<li>Широкий выбор для парней. Какие чехлы для &laquo;Мейзу&raquo; привлекут внимание молодого человека? Несомненно, качественные, но при этом со сдержанными принтами и окрасами. Хотите повеселее? Пожалуйста! В ассортименте огромное количество товара, начиная с изображений героев мультфильмов до картинок 18+.</li>\r\n	<li>Многообразие принтов для девушек. Для прекрасной половины &ndash; только самые красивые и изысканные чехлы для Meizu, которые смогу подчеркнуть индивидуальность хозяйки и выделить её из толпы барышень с типичными классическими бамперами или массивными &laquo;книжками&raquo;.</li>\r\n	<li>Высокое качество. Можете быть уверены в надёжности и долговечности покупки. Чехлы для &laquo;Мейзу&raquo; от Endorphone отличаются высоким качеством. Для производства используются краски, не выцветающие даже от прямого воздействия солнечных лучей. Заготовки из пластика или силикона (на выбор клиента) прочны и надёжно защитят ваше устройство даже при падении с большой высоты.</li>\r\n	<li>Невысокая стоимость. Приемлемая цена на любой вид товара позволяет купить не один, а сразу несколько чехлов для постоянной смены имиджа. Сегодня вы в образе милой девочки? Чехлы для &laquo;Мейзу&raquo; с мультяшными персонажами дополнят ваш стиль. Решили надеть строгое чёрное платье? Классические варианты со сдержанным принтом станут отличным выбором.</li>\r\n	<li>Прямая продажа. Мы являемся производителем товара, а не посредником, и закупаем лишь заготовки и инструменты, необходимые для нанесения рисунка.</li>\r\n	<li>Комфортный поиск. Найти то, что нужно &ndash; легко. Весь товар распределён на тематические разделы, в которых удобно найти аксессуар своей мечты.</li>\r\n</ol>\r\n<p>Силикон хорошо амортизирует, а&nbsp;пластик устойчив к&nbsp;высоким температурам. По&nbsp;качеству они не&nbsp;уступают друг другу, так что выбор полностью зависит от&nbsp;вашего вкуса&nbsp;&mdash; выбирайте исходя из&nbsp;личных предпочтений. У&nbsp;нас имеется огромное количество чехлов с&nbsp;самыми разными принтами: с&nbsp;<a href="http://endorphone.com.ua/silicone-case/flowers">цветами</a>, известными брендами, фото автомобилей, на&nbsp;спортивную тематику, с&nbsp;персонажами&nbsp;<a href="http://endorphone.com.ua/silicone-case/serial">сериалов</a>&nbsp;и&nbsp;т.&nbsp;д. Каждый человек найдет что-то подходящее для своего смартфона.</p>\r\n<h2>&nbsp;Где можно купить чехлы для устройств Meizu в Украине?</h2>\r\n<p>Интернет-магазин Endorphone предлагает огромный ассортимент товара для любых мобильных телефонов производителя &laquo;Мейзу&raquo;. Заказать чехол очень просто. Нужно всего лишь выбрать понравившийся бампер и заполнить форму. Доставка осуществляется удобной для клиента транспортной компанией. Через 1&ndash;3 дня надёжная защита смартфона будет у вас в руках.&nbsp;</p>\r\n<h2>Мы&nbsp;создадим для вас уникальный чехол</h2>\r\n<p>Купить неповторимый аксессуар для телефона можно в&nbsp;интернет-магазине &laquo;Endorphone&raquo;. Если даже не&nbsp;найдете подходящего рисунка у&nbsp;нас в&nbsp;каталоге, можно заказать чехол онлайн со&nbsp;своей картинкой. Вы&nbsp;можете использовать фото, свое или родных людей, а&nbsp;также любую другую картинку. На&nbsp;корпусе смартфона она будет прекрасно смотреться и&nbsp;сделает ваш девайс уникальным. Очень маленькая вероятность того, что вы&nbsp;увидите у&nbsp;кого-то такой&nbsp;же рисунок на&nbsp;аксессуаре, как и&nbsp;у&nbsp;вас. В&nbsp;нашем магазине используется только высококачественное печатное оборудование. Качество оригинала картинки в&nbsp;полной мере отобразится на&nbsp;вашем чехле. Не&nbsp;забывайте, что при покупке двух товаров доставка бесплатная. Мы&nbsp;приложим максимум усилий, чтобы сделать именно такой чехол, о&nbsp;котором вы&nbsp;мечтали.</p>'),
(17, 'Microsoft', 'Майкрософт', 'microsoft', 'microsoft-17.jpg', '', 0, 0, 15, 'Чехол на Microsoft в Украине | endorphone.com.ua', 'купить чехол для microsoft, чехол на microsoft, купить чехол для microsoft в украине, чехол на microsoft цена, купить, цена, стоимость, продажа, недорого, Украина, интернет магазин, Эндорфон', 'Купить чехол для microsoft по доступной цене. Предлагаем заказать чехол на microsoft с доставкой по всей Украине. Звоните &#9743; 044 393 40 31.', 'Чехол на Microsoft', '<h2>Чехлы для телефонов Microsoft</h2>\r\n<p><img alt="Чехлы для Microsoft" src="http://endorphone.com.ua/logo/vmicrosoft-lumia-430-153-p-170.jpg" style="float: left;" title="Чехлы для Microsoft"></p>\r\n<p>Microsoft &mdash; американский транснациональный гигант-производитель самых известных и чтимых марок мобильных телефонов. Данная корпорация уверенно держится на рынке техники уже не первый год и регулярно удивляет покупателей новыми гаджетами. Каждый телефонный аппарат обладает уникальными особенностями и характеристиками, а линейный ряд устройств Майкрософт не похож ни на какую модель. И эти телефоны нуждаются в надлежащей защите, именно поэтому, дабы обезопасить своё устройство от механических повреждений, мы советуем купить чехол на Microsoft.</p>\r\n<h2>Стильно и надежно</h2>\r\n<p>Каждый владелец желает сохранить свой смартфон в товарном виде как можно дольше, уберечь его от появления царапин, попадания воды и прочих нежелательных моментов, которые могут сыграть злую шутку с устройством. Эту проблему поможет решить силиконовый или резиновый чехол на Microsoft. К тому же он не только послужит средством защиты, а и стильным аксессуаром, который придаст гаджету яркость и неповторимость. Также чехлы подчёркивают индивидуальность человека, свидетельствуют об отличном вкусе и предпочтениях его обладателя.</p>\r\n<p>Если вы не хотите выделяться из толпы, то спешим посоветовать вам, купить чехол для Microsoft. В Украине его можно приобрести, например, в интернет-магазине Endorphone. У нас вы сможете заказать свой неповторимый аксессуар, к тому же цены здесь не кусаются. Удивите родных и близких, вызывайте восторг окружающих своей покупкой, сделайте акцент на своей оригинальности. В каталоге имеется огромное количество моделей и изображений для чехлов:</p>\r\n<ul>\r\n	<li><a href="http://endorphone.com.ua/silicone-case/art">арт</a>;</li>\r\n	<li>цветочные композиции;</li>\r\n	<li>космические рисунки;</li>\r\n	<li>классические варианты;</li>\r\n	<li><a href="http://endorphone.com.ua/silicone-case/auto-moto">авто/мото</a>;</li>\r\n	<li>абстракции.</li>\r\n</ul>\r\n<p>А что самое главное &mdash; у нас можно недорого купить персональный именной чехол. Такого аксессуара уж точно вы не встретите больше ни у кого. Вы можете самостоятельно выбирать цвет, шрифт и надпись (имя, фамилия).</p>\r\n<p>Стоимость варьируется в зависимости от сложности изображения и качества желаемого материала.</p>\r\n<h2>У нас есть всё, чего душа желает</h2>\r\n<p>Купить чехол для Microsoft на свой мобильный телефон очень просто. Сделать это можно в режиме онлайн. Наш интернет-магазин оснащён передовым оборудованием для нанесения печати, поэтому изображение будет на все 100% соответствовать заказу. А цена на всю продукцию интернет-магазина очень демократична.</p>\r\n<p>&nbsp;Изготовление осуществляется очень быстро. Если вы сделаете заказ до 14:00, то ваш товар мы вышлем в этот же день.</p>\r\n<p>Спасибо, что выбираете именно наш интернет магазин!&nbsp;</p>'),
